# Configurações de modelos para testar
hidden_layer_sizes = [(100,), (50, 50), (30, 30, 30)]  # Diferentes configurações de camadas ocultas
learning_rates = [0.001, 0.01, 0.1]  # Taxas de aprendizado diferentes
momentums = [0.0, 0.5, 0.9]  # Momentos diferentes

num_trainings = 20  # Número de treinamentos por modelo

# Treinamento e salvamento dos modelos
for layer_size in hidden_layer_sizes:
    for lr in learning_rates:
        for momentum in momentums:
            model_name = f"MLP_{layer_size}_LR_{lr}_Momentum_{momentum}.pkl"
            model = MLPClassifier(hidden_layer_sizes=layer_size, learning_rate_init=lr, momentum=momentum)

            # Treinamento múltiplo para estatísticas mais realistas
            for i in range(num_trainings):
                model.fit(X_train, y_train)
                
            # Salvando o modelo treinado
            joblib.dump(model, model_name)
